
var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 562,
        height: 1000,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        // var downloadBtn = this.add.sprite(game.config.width / 2, game.config.height / 2, 'btn_download')
        //     .setInteractive();

        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);

        var json = {
            bg:{
                key:'bg',
            },
            difference:[
                {
                    key:'',
                    name:'shuding',
                    position:{
                        top:{
                            x:260,
                            y:30
                        },
                        down:{
                            x:260,
                            y:560
                        }
                    },
                    size:{
                        width:120,
                        height:80
                    },
                    debug:false,
                    guide:true
                },
                {
                    key:'',
                    name:'yueliang',
                    position:{
                        top:{
                            x:235,
                            y:205
                        },
                        down:{
                            x:235,
                            y:740
                        }
                    },
                    size:{
                        width:50,
                        height:70
                    },
                    debug:false,
                    guide:false
                },
                {
                    key:'',
                    name:'hezi',
                    position:{
                        top:{
                            x:370,
                            y:430
                        },
                        down:{
                            x:370,
                            y:960
                        }
                    },
                    size:{
                        width:130,
                        height:100
                    },
                    debug:false,
                    guide:false
                }
            ],

        }
        this.difference(json)


        this.resize();
        window.addEventListener("resize", this.resize, false);
    }


    difference(json){
        var this_ = this
        var diffName_top = [],diffName_down = []
        var rightNum = 0

        render()
        guide()
        function render(params) {
            var bg= this_.add.image(0,0,'bg').setOrigin(0,0).setInteractive().on('pointerdown',wrong)
            for (let i = 0; i < json.difference.length; i++) {
                var top = json.difference[i].position.top
                var down = json.difference[i].position.down
                var scaleX = json.difference[i].size.width/60
                var scaleY = json.difference[i].size.height/60
                diffName_top[i] = this_.add.image(top.x,top.y,'icon').setDepth(0).setScale(scaleX,scaleY).setAlpha(0.001).setName(json.difference[i].name).setInteractive().once('pointerdown',right);
                diffName_down[i] = this_.add.image(down.x,down.y,'icon').setDepth(0).setScale(scaleX,scaleY).setAlpha(0.001).setName(json.difference[i].name).setInteractive().once('pointerdown',right);
                if(json.difference[i].debug == true){
                    var graphics = this_.add.graphics();
                    var bounds1 = diffName_top[i].getBounds()
                    graphics.lineStyle(1, 0xff0000);
                    graphics.strokeRectShape(bounds1)
                    var graphics2 = this_.add.graphics();
                    var bounds2 = diffName_down[i].getBounds()
                    graphics2.lineStyle(1, 0xff0000);
                    graphics2.strokeRectShape(bounds2)
                }         
            }
        }
        function right(params) {
            var position = {top:{},down:{}}
            for (let i = 0; i < diffName_top.length; i++) {
                if(diffName_top[i].name == this.name){
                    position.top.x = diffName_top[i].x
                    position.top.y = diffName_top[i].y
                    diffName_top[i].off('pointerdown')
                }
                if(diffName_down[i].name == this.name){
                    position.down.x = diffName_down[i].x
                    position.down.y = diffName_down[i].y
                    diffName_down[i].off('pointerdown')
                }                 
            }
            rightNum++
            var right1  = this_.add.image(position.top.x,position.top.y,'right').setDepth(0).setScale(1.5).setAlpha(1);
            var right2  = this_.add.image(position.down.x,position.down.y,'right').setDepth(0).setScale(1.5).setAlpha(1);
            this_.tweens.add({
                targets:[right1,right2],
                angle:-360,
                duration:300,
                yoyo:false,
                repeat:0,
                onComplete:()=>{
                    if(rightNum == json.difference.length){
                        setTimeout(() => {
                            this_.showDownload()
                        }, 1000);
                    }
                },
            },this);
        }
        function wrong(pointer) {
            var wrong = this_.add.image(pointer.x,pointer.y,'wrong').setScale(1.5)
            this_.tweens.add({
                targets:[wrong],
                angle:30,
                duration:150,
                yoyo:true,
                repeat:0,
                onComplete:()=>{
                    wrong.destroy()
                },
            },this);
        }
        function guide(params) {
            var hand = this_.add.image(-500,-500,'hand').setDepth(0).setScale(0.7).setAlpha(1).setDepth(2).setOrigin(0.1,0);
            var right = this_.add.image(-500,-500,'right').setDepth(0).setScale(1.5).setAlpha(0).setDepth(1).setVisible(1)
            repeat()
            function repeat(params) {
                var handAnmi = this_.tweens.add({
                    targets:[hand],
                    scaleX:0.8,
                    scaleY:0.8,
                    duration:300,
                    yoyo:true,
                    repeat:-1
                    // onComplete:()=>{
                    //     hand.setVisible(0)
                    //     right.setVisible(1)
                    //     this_.tweens.add({
                    //         targets:[right],
                    //         angle:360,
                    //         duration:300,
                    //         onComplete:()=>{
                    //             right.setVisible(0)
                    //             setTimeout(() => {
                    //                 hand.setVisible(1)
                    //                 repeat()
                    //             }, 300);
                    //         },
                    //     },this_);
                    // }
                },this_);
            }
            
            for (let i = 0; i < json.difference.length; i++) {
                if(json.difference[i].guide == true ){
                    hand.setPosition(json.difference[i].position.top.x,json.difference[i].position.top.y+10)
                    right.setPosition(json.difference[i].position.top.x,json.difference[i].position.top.y)
                }
            }
            this_.input.on('pointerdown',function (params) {
                hand.setAlpha(0)
                right.setAlpha(0)
            })
        }
    }

    showDownload(){
        var width = game.config.width
        var height = game.config.height

        var ceng = this.add.image(0, 0, 'bg').setOrigin(0, 0).setAlpha(0.001).setDepth(2).setInteractive()
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0;
        graphics1.setDepth(1);
        graphics1.fillRectShape(rect);
        this.tweens.add({
            targets: graphics1,
            alpha: 0.8,
            duration: 300
        })
        var win_bg = this.add.image(width/2,-200,'win_bg').setDepth(3).setScale(1.5).setAlpha(1);
        var download = this.add.image(width/2,630,'btn_download').setDepth(5).setScale(0).setAlpha(1).setInteractive().on('pointerdown',function (params) {
            landingPage()
        });
        var win_bg_anmi = this.tweens.add({
            targets:[win_bg],
            y:height/2-100,
            duration:500,
            yoyo:false,
            repeat:0,
            ease:"Back",
            onComplete:()=>{
                this.tweens.add({
                    targets:[download],
                    scaleX:2,
                    scaleY:2,
                    duration:300,
                    onComplete:()=>{
                        this.tweens.add({
                            targets:[download],
                            scaleX:2.2,
                            scaleY:2.2,
                            duration:300,
                            yoyo:true,
                            repeat:-1,
                            onComplete:()=>{},
                        },this);
                    },
                },this);
            },
        },this);
    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

var assets = {"win_bg": "data:image/png;base64,", "woman": "data:image/png;base64,", "tw": "data:image/png;base64,", "hand": "data:image/png;base64,", "wrong": "data:image/png;base64,", "right": "data:image/png;base64,", "bg": "data:image/png;base64,", "man": "data:image/png;base64,", "circle": "data:image/png;base64,", "icon": "data:image/png;base64,", "btn_retry": "data:image/png;base64,", "btn_download": "data:image/png;base64,"}